import React from 'react';
import { Container } from 'semantic-ui-react';
import Head from 'next/head';
import Header from './Header';
import './Layout.css'

export default props => {
  return (
    <Container>
      <Head>
        <link rel="stylesheet" href="semantic.min.css" />
      </Head>
      <Header />
      {props.children}
    </Container>
  );
};
